MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "The general properties of SmartParts and primitive geometry shapes of Simcenter Flotherm software.");
MGCAddSnippet(5, "To save time when building complicated structures, pre-built model macros (or templates) of shapes and equipment, called SmartParts, are supplied which are easily adapted to suit your model.");
MGCAddSnippet(6, "SmartParts and Primitives are created as members of a parent assembly, and have, by default, their origins located at the origin of the parent assembly.");
MGCAddSnippet(7, "Enclosure Walls, Holes, and Sloping Blocks can be modeled as Thick or Thin.");
MGCAddSnippet(8, "The following procedures are general procedures applicable to SmartParts and primitives.");
MGCAddSnippet(9, "Cuboids and Network Cuboids can be collapsed from their 3D default structures to 2D planes. Collapsing to 2D increases the efficiency of modeling.");
MGCAddSnippet(10, "Some SmartParts can be decomposed into their constituent independent primitives.");
MGCAddSnippet(11, "Consistency checks are performed for SmartParts during property sheet data input.");
MGCAddSnippet(12, "Property sheet tabs that are common to more than one SmartPart.");
MGCAddSnippet(13, "Use this tab to relocate the object by entering its new position, to collapse the object to 2D, to localize the grid on the object, to deactivate or hide the object, or to remove children from the data tree (lightweight tree view).");
MGCAddSnippet(14, "Use this tab to attach or detach attributes to or from the selected object.");
MGCAddSnippet(15, "Use this tab to assign group and sub-group names to objects for CI (Capture Index) analysis, and to assign a Cooler Group name to a Rack or Cooler when using remote rack temperature to control cooler airflow. ");
MGCAddSnippet(16, "Use this dialog to create and assign a new Aisle Group name to a Cooler, Rack, Recirculation Device, Fixed Flow or Perforated Plate, or a new Cooler Group name to a Cooler or Rack.");
MGCAddSnippet(17, "Use the Notes tab of property sheets to add any relevant information about an object or attribute.");
MGCAddSnippet(18, "Use Assembly SmartParts to group together components so that they can be moved as a single entity.");
MGCAddSnippet(19, "All modeling objects belong to a parent assembly. By default, the  Root Assembly  is the top-level assembly.");
MGCAddSnippet(20, "Organize your model by adding assemblies to the Root assembly and then adding objects/geometry to those assemblies.");
MGCAddSnippet(21, "Use assemblies to organize the objects in your model.");
MGCAddSnippet(22, "Geometry can be added as new default specification SmartParts or as configured library items. In addition, you can import assemblies from other systems.");
MGCAddSnippet(23, "Use this property sheet to configure an assembly.");
MGCAddSnippet(24, "Use Block with Holes SmartParts when modeling apertures in materials, or composite materials such as windows, in which case the hole is filled with an alternative material to the block.");
MGCAddSnippet(25, "Blocks with Holes are cuboids with holes, like cuboids, they can be collapsed but they can also be decomposed.");
MGCAddSnippet(26, "Block With Holes SmartParts are not added from the Objects Palette like other SmartParts, they are created from existing Cuboids in the model.");
MGCAddSnippet(27, "Use this property sheet to configure a block with holes.");
MGCAddSnippet(28, "Use this tab to change the overall size of a Block with Holes SmartPart and/or alter the direction of any of its holes.");
MGCAddSnippet(29, "Use Compact Component SmartParts to represent array and peripheral lead packages.");
MGCAddSnippet(30, "Compact Component SmartParts are resistor network representations of packages and can be used when the resistance values are known for the component.");
MGCAddSnippet(31, "There are two computational network models provided for simulating the resistor networks of these packages: the 2-Resistor Model and the General Model.");
MGCAddSnippet(32, "The 2-Resistor Model is the simplest representation generic to all package types, consisting of two cuboid layers.");
MGCAddSnippet(33, "Use the General Model when you want to model compact components in detail.");
MGCAddSnippet(34, "Included are some examples of different Compact Component geometry.");
MGCAddSnippet(35, "2-resistance models comprise two equal layers. General models comprise three layers where the top and bottom core areas can be separately defined.");
MGCAddSnippet(36, "Network connectivity is fixed for 2-Resistor models but unfixed for General models.");
MGCAddSnippet(37, "After solution, the temperatures for the package case, PCB, leads (for leaded packages), the displayed junction temperature and the maximum junction temperature (where the model contains more than one junction) can be displayed in tables. Fluxes are shown for the case top, case sides, PCB, and leads (for leaded packages).");
MGCAddSnippet(38, "Use this property sheet to define the properties of the Compact Component (compact resistor package).");
MGCAddSnippet(39, "Use this tab to select the package type, configuration (raised/flat top), junction power input and whether to simulate the effects of radiation.");
MGCAddSnippet(40, "Use this tab to specify the size of the structure. The geometry representation depends on the Model Type chosen in the Model tab.");
MGCAddSnippet(41, "Use this tab to define the balls/pins connections for an area array package when using a star or general network model.");
MGCAddSnippet(42, "Use this tab to define the lead distribution for general-model, peripheral-package-type compact components.");
MGCAddSnippet(43, "Use this tab to specify the network resistances between the nodes of the component.");
MGCAddSnippet(44, "Use the Controller SmartPart to create a frequency-based power controller.");
MGCAddSnippet(45, "Use Controller SmartParts to change power when set high and low temperatures are reached.");
MGCAddSnippet(46, "Use this property sheet to configure a controller.");
MGCAddSnippet(47, "Use this property sheet tab to attach a Control attribute to the controller and to select the initial power control curve. Also, use this property sheet to find out which power curve is in use if a solve is interrupted or stopped. ");
MGCAddSnippet(48, "Use Cooler SmartParts to model Data Center cooling units.");
MGCAddSnippet(49, "The Cooler SmartPart can represent any row-based or room-based Data Center cooling unit.");
MGCAddSnippet(50, "When Coolers are created, they have Extract and Supply SmartParts added as children.");
MGCAddSnippet(51, "Cooler groups are used when a cooler s airflow is set to be controlled by remote rack temperature. ");
MGCAddSnippet(52, "When using Rack temperature to control Cooler airflow, at least one Cooler and one Rack must be assigned to the same Cooler Group. ");
MGCAddSnippet(53, "Cooler Group attachments can be seen in the summary information table provided they have been switched on for display.");
MGCAddSnippet(54, "A capacity curve provides the capability to manually define, or import data from a CSV file, a curve definition defining Cooler Capacity limit (power) versus Return Temperature.");
MGCAddSnippet(55, "The Cooler Capacity vs. Return-Temperature curve for a real cooler is almost always measured at maximum airflow rate.");
MGCAddSnippet(56, "A cooler capacity curve can be defined either by importing a CSV file or adding points interactively. Such data is available from manufacturers.");
MGCAddSnippet(57, "Use this file to create a Cooler SmartPart capacity curve by file import as an alternative to manually adding data directly into the Capacity Curve dialog box.");
MGCAddSnippet(58, "Use this dialog box to define a cooler capacity curve from a sequence of points.");
MGCAddSnippet(59, "Use this property sheet to configure a cooler.");
MGCAddSnippet(60, "Use this property sheet tab to specify the flow, set point and capacity of a Cooler SmartPart.");
MGCAddSnippet(61, "Use cuboids, prisms, tets (tetrahedra), and inverted tets, collectively referred to as primitives, to model structures.");
MGCAddSnippet(62, "Primitives are used to model structures whose shapes are considered hydraulically equivalent by setting dimensions to achieve the same surface area.");
MGCAddSnippet(63, "By default, primitive primitives are created as smooth, non-conducting solids.");
MGCAddSnippet(64, "Depending on the transparency definition in the materials attached to cuboids, solar radiation will be either fully blocked, partially blocked/absorbed or fully transparent to solar radiation.");
MGCAddSnippet(65, "Use this property sheet to configure a cuboid, prism, tet, or inverted tet.");
MGCAddSnippet(66, "If the required solution domain is not of a regular cuboid shape, then use Cutout SmartParts to remove sections of the solution domain.");
MGCAddSnippet(67, "A cutout defines the size and location of regions of the domain regarded as external to the model and, therefore, excluded from the program solution.");
MGCAddSnippet(68, "Use this property sheet to configure a cutout.");
MGCAddSnippet(69, "Use this property sheet to define all or individual (six) faces of the Cutout and their ambient attribute(s).");
MGCAddSnippet(70, " Use Cylinder SmartParts to model curved volumes.");
MGCAddSnippet(71, "The Cylinder SmartPart uses a combination of primitives (cuboids and prisms) to approximate a cylindrical shape. Cylinder SmartParts are added to the data tree as children of assemblies.");
MGCAddSnippet(72, "Use this property sheet to configure a cylinder.");
MGCAddSnippet(73, "Use this property sheet tab to modify the representation of cylindrical components, such as capacitors.");
MGCAddSnippet(74, "Use Die SmartParts to model dies, the rectangular sections of silicon that are the heart of a package.");
MGCAddSnippet(75, "Die SmartParts can be used to investigate changes in die power distribution and packing.");
MGCAddSnippet(76, "Dies can be modeled as uniform or non-uniform sources of heat.");
MGCAddSnippet(77, "By default, the Die SmartPart has a Silicon (Pure) Material attribute attached via the Construction tab of the property sheet, rather than the Attachments tab.");
MGCAddSnippet(78, "The Die SmartPart is modeled as a cuboid with one or more 2D source objects on the Zo high face of the cuboid representing discrete or total coverage sources.");
MGCAddSnippet(79, "Non-uniform power dissipation is modeled by defining the power output at specified rectangular locations, termed discrete sources. ");
MGCAddSnippet(80, "Non-uniform power dissipation is modeled by defining the power output at selected rectangular locations across the face of the die.");
MGCAddSnippet(81, "The following subsections give information about Die SmartParts represented in results tables, the Command Center, and MCAD Bridge.");
MGCAddSnippet(82, "Use this file to create a Die power distribution map by file import as an alternative to entering data into the table of the Non-Uniform Discrete Source Definition dialog box.");
MGCAddSnippet(83, "Use this file to create a Die power distribution map by file import as an alternative to manually adding data directly into the Non-Uniform Total Coverage Source Definition dialog box.");
MGCAddSnippet(84, "Use this property sheet to configure a die.");
MGCAddSnippet(85, "Use this property sheet tab to define the thermal characteristics of the selected Die SmartPart.");
MGCAddSnippet(86, "Use this dialog box to define the locations and power values of rectangular sources over the Zo-High face of the die.");
MGCAddSnippet(87, "Use this dialog box to define the power output at rectangular cells across the face of the die.");
MGCAddSnippet(88, "Use Enclosure SmartParts to model containers. The size of a new Enclosure is that of the solution domain. ");
MGCAddSnippet(89, "An Enclosure SmartPart is made up of up to six 3D or 2D walls.");
MGCAddSnippet(90, "Holes can be added to enclosure walls to allow the specification of airflow in and out.");
MGCAddSnippet(91, "The following sub sections provide advice when modeling enclosures.");
MGCAddSnippet(92, "Use this property sheet to configure an enclosure.");
MGCAddSnippet(93, "Use this tab to change the definition of the boundary walls of a cuboid space within the calculation domain. The enclosure boundaries can be solid, punctured with holes (which can be filled with a specified material, resistance, or set completely free). They are used to represent the box containing the electronics in the system being modeled, for example, PSU enclosures, system cabinet, sub-racking.");
MGCAddSnippet(94, "Use this property sheet to configure an enclosure wall.");
MGCAddSnippet(95, "Use this tab to change the wall name.");
MGCAddSnippet(96, "Use this tab when individual walls of an enclosure require distinct modeling.");
MGCAddSnippet(97, "Extracts are children of Recirculation Device, Rack, and Cooler SmartParts.");
MGCAddSnippet(98, "Rotating and overlapping extracts.");
MGCAddSnippet(99, "Use this property sheet to configure an extract.");
MGCAddSnippet(100, "Use this property sheet tab to locate the extraction zone (for example, the intake of a heater) of a recirculation device.");
MGCAddSnippet(101, "Use the Fan SmartPart to model an inlet, outlet, or internal axial or rectangular fan.");
MGCAddSnippet(102, "The Fan SmartPart can be used to model axial or rectangular fans which can be configured to simulate a variety of designs.");
MGCAddSnippet(103, "The properties of Fan SmartParts are described in the following subsections and in the property sheet description.");
MGCAddSnippet(104, "For 3D models, the intake side of the fan assembly is always located on the boundary side that would still exist after collapsing the fan to 2D.");
MGCAddSnippet(105, "Angled flow from intake fans, fixed flows and supplies is specified by three values, namely the local x-coordinate, Xo, the local y-coordinate, Yo, and the local z-coordinate, Zo.");
MGCAddSnippet(106, "The dissipated fan power is the power dissipated as heat (heat energy), as opposed to the power used to turn the fan (mechanical energy).");
MGCAddSnippet(107, "Axial fans can be 2D or 3D of varying complexity.");
MGCAddSnippet(108, "Rectangular fan models are always 2D objects, whose dimensions are defined by the side lengths, Xo and Yo.");
MGCAddSnippet(109, "The possible fan flow types are Normal, Angled, and Swirl.");
MGCAddSnippet(110, "Flow can be specified as fixed volume, or by linear or non-linear relationships of flow rate with pressure.");
MGCAddSnippet(111, "For an intake fan on the domain boundary, the fluid is drawn in from the external environment. By default, the fluid brought in this way is at the ambient temperature applied to the sides of the overall system domain using the Ambient attributes.");
MGCAddSnippet(112, "A linear fan flow specification is an attempt to model the fan according to a linear representation as close as possible to the manufacturer s fan characteristic.");
MGCAddSnippet(113, "Fans are often set to run below their maximum capacity, to reduce noise and increase their lifetime, but still achieve thermal cooling requirements.");
MGCAddSnippet(114, "You can attach Material, Radiation, Resistance, and Transient attributes to fans.");
MGCAddSnippet(115, "This section describes how to define a characteristic curve and angled flow.");
MGCAddSnippet(116, "A fan characteristic curve of volume flow rates at different pressures can be defined either by importing a CSV file or adding points interactively. ");
MGCAddSnippet(117, "A 2D flow angle is specified by one angle from the Normal. In such cases, either the Xo-direction or Yo-direction component is zero.");
MGCAddSnippet(118, "A 3D flow angle is specified by two angles from the Normal.  In such cases, the Xo- and Yo-direction components are non-zero.");
MGCAddSnippet(119, "Angled fans can be created by rotating rectangular fans about a chosen axis.");
MGCAddSnippet(120, "Used this file to create a Fan SmartPart characteristic curve by file import as an alternative to manually adding data directly into the Fan Curve Chart dialog box.");
MGCAddSnippet(121, "Use this property sheet to configure a fan. ");
MGCAddSnippet(122, "Use this tab to define the dimensions, flow rate and flow direction of a Fan SmartPart.");
MGCAddSnippet(123, "Use this dialog box to define a fan characteristic curve from a sequence of points.");
MGCAddSnippet(124, "Use the Fixed Flow SmartPart when you want to model a constant flow of fluid into or out of the solution domain.");
MGCAddSnippet(125, "The Fixed Flow SmartPart specifies the flow conditions for a surface when the flow rate and the temperature entering the device is known.");
MGCAddSnippet(126, "The properties of Fixed Flow SmartParts are described in the following subsections and in the property sheet description.");
MGCAddSnippet(127, "Free Area Ratio is a measure of any obstruction to the flow through the device, for example, a grille across the flow path.");
MGCAddSnippet(128, "Fixed Flows can be a flow direction into the solution domain (Inflow) or out of an enclosure (Outflow).");
MGCAddSnippet(129, "Fixed Flow SmartParts are 2D rectangles that represent apertures through which fluid flows.");
MGCAddSnippet(130, "Fixed flows must not be placed in free air, they must be placed on the solution boundary, the surface of a thick wall of an enclosure, or the face of an uncollapsed cuboid. ");
MGCAddSnippet(131, "Use this property sheet to configure a fixed flow.");
MGCAddSnippet(132, "Use this property sheet tab to model a constant flow of air, either entering or leaving, through a device.");
MGCAddSnippet(133, "Use the Heat Pipe SmartPart to model a heat pipe by defining its thermal characteristics. Use Network Cuboid or Cuboid SmartParts to form the structure of the heat pipe.");
MGCAddSnippet(134, "Advice when using heat pipe manufacturer's data.");
MGCAddSnippet(135, "A heat pipe modeled by Simcenter Flotherm is an assembly of network cuboids which have a very low thermal resistance as defined by heat pipe performance data.");
MGCAddSnippet(136, "A Heat Pipe SmartPart is a point in space, therefore, heat pipes are physically modeled by adding Network Cuboid or Cuboid SmartParts.");
MGCAddSnippet(137, "Use this property sheet to configure a heat pipe.");
MGCAddSnippet(138, "Use this property sheet tab to define the effective thermal resistance of the selected Heat Pipe SmartPart.");
MGCAddSnippet(139, "Heat Sink SmartParts can have plate or pin fins.");
MGCAddSnippet(140, "This section gives modeling advice for heat sinks.");
MGCAddSnippet(141, "The design variations supported by Simcenter Flotherm are plate and pin fin heat sinks, which are formed by either extrusion, casting, or bonding.");
MGCAddSnippet(142, "In some circumstances, the overhead in modeling the fins in detail in a system level analysis can be avoided by using the compact heat sink model.");
MGCAddSnippet(143, "Bonded fin heat sinks are constructed by bonding fins into grooves cut in the base of the heat sink.");
MGCAddSnippet(144, "One reason for using compact models is to reduce the grid. When modeling detailed heat sinks, a large number of grid cells are required.");
MGCAddSnippet(145, "There are two modeling methods: Detailed and Compact. ");
MGCAddSnippet(146, "The properties of Heat Sink SmartParts are described in the following subsections and in the property sheet description.");
MGCAddSnippet(147, "There are two methods of fabrication: Extruded/Cast and Bonded");
MGCAddSnippet(148, "The size of the heat sink base is with reference to the heat sink origin.");
MGCAddSnippet(149, "Heat sink with either plate fins or pin fins can be modeled. The properties of those fins are described in the following subsections");
MGCAddSnippet(150, "Plate fins and pin fins share some common characteristics such as tapered fins and can be arranged with center gaps,");
MGCAddSnippet(151, "Plate fins can be inset from the heat sink base, and the end fins can be separately defined.");
MGCAddSnippet(152, "Pin fins can be rectangular or circular in cross section, and can be arranged in line or staggered. The height of a pin fin is the distance from the base to the tip.");
MGCAddSnippet(153, "Use this property sheet to configure a heat sink.");
MGCAddSnippet(154, "Use this property sheet tab to change the specification of a plate or pin fin Heat Sink SmartPart. The Heat Sink SmartPart supports plain fin designs which are formed by extrusion, casting, or bonding.");
MGCAddSnippet(155, "Use this property sheet tab to define the number, size, and layout of the internal (not the end) plate fins on a heat sink.");
MGCAddSnippet(156, "Use this property sheet tab to define the end fins of a plate fin heat sink. In addition, an optional bracket can be attached to end plate fins.");
MGCAddSnippet(157, "Use this property sheet tab to define the heat sink pin shape, style, and dimensions.");
MGCAddSnippet(158, "Use this property sheet tab to define how the heat sink pins are arranged over the base.");
MGCAddSnippet(159, "Use Hole SmartParts to create rectangular-shaped ventilation gaps, more complex-shaped holes can be created using MCAD Bridge. Optionally, a hole can be filled and can have a defined resistance to flow.");
MGCAddSnippet(160, "Holes can only be created as children of Cuboid SmartParts or children of Walls of Enclosure SmartParts.");
MGCAddSnippet(161, "How to copy, locate, and resize holes.");
MGCAddSnippet(162, "You can create more complex holes by transferring geometry to MCAD Bridge, modifying it there, then transferring it back.");
MGCAddSnippet(163, "Vents can be modeled by specifying the flow boundaries over holes created in enclosures or blocks.");
MGCAddSnippet(164, "Use this property sheet to configure a hole.");
MGCAddSnippet(165, "Use this property sheet tab to change holes added to a cuboid block or enclosure wall and, where necessary, replace the hole with a specified material or resistance.");
MGCAddSnippet(166, "Use Monitor Point SmartParts when you want to monitor variables (usually temperature) at specific positions in the solution domain.");
MGCAddSnippet(167, "The default location and name of a monitor point depends on what was selected in the data tree before it was added.");
MGCAddSnippet(168, "Monitor Points are used to check the variation of the field variables.");
MGCAddSnippet(169, "Add monitor points at locations at which you want to check the variation of the field variables.");
MGCAddSnippet(170, "Use this property sheet to rename or change the position of a monitor point, or to deactivate or hide the monitor point.");
MGCAddSnippet(171, "The Network Assembly SmartPart can be used as a generalized thermal resistance for modeling a range of electronic parts, including multi-die and stacked-die packages.");
MGCAddSnippet(172, "A network assembly is an assembly of objects with surfaces that behave as nodes in a network of thermal resistors.");
MGCAddSnippet(173, "The complete structure of a network assembly is represented in the data tree as a hierarchical group of nodes and cuboids.");
MGCAddSnippet(174, "This section describes how to create network assemblies and how to define node resistance and capacitance values.");
MGCAddSnippet(175, "Create network assemblies by adding Network Nodes to Network Assemblies, then Network Cuboids to Network Nodes.");
MGCAddSnippet(176, "The thermal resistances between pairs of nodes in a network assembly are specified in table format.");
MGCAddSnippet(177, "The thermal capacitances at nodes in a network assembly are specified in table format.");
MGCAddSnippet(178, "Examples of Network Assemblies are given in the following sections.");
MGCAddSnippet(179, "In this example, the Network Assembly includes three nodes: Junction, Case, and Board.");
MGCAddSnippet(180, "The example given here is for a Dual-Leaded package with one Junction node.");
MGCAddSnippet(181, "The transformer model has two network nodes that represent the windings and armature.");
MGCAddSnippet(182, "Network Assemblies are defined by Network Assembly, Network Node and Network Cuboid property sheets.");
MGCAddSnippet(183, "Use this property sheet to configure a network assembly.");
MGCAddSnippet(184, "Use this property sheet tab to set the resistance values between the nodes for the selected Network Assembly.");
MGCAddSnippet(185, "Use this property sheet tab to set the thermal capacitance for each network node for the selected Network Assembly.");
MGCAddSnippet(186, "Use tis property sheet to configure a network node.");
MGCAddSnippet(187, "Use this property sheet to configure a network cuboid.");
MGCAddSnippet(188, "Use the PCB SmartPart to create basic models of non-conducting or conducting PCBs.");
MGCAddSnippet(189, "Non-conducting PCBs are normally used in forced convection systems. Conducting PCBs are normally used for natural convection cases");
MGCAddSnippet(190, "Non-Conducting PCBs only require the setting of the proportion of the heat dissipated locally to the air on the side that the component is defined, and the surface roughness.");
MGCAddSnippet(191, "Model PCB SmartParts as Conducting when conduction along a board is significant. You will need to specify the board composition.");
MGCAddSnippet(192, "PCB SmartParts are created as children of assemblies. By default, a non-conducting PCB is created, one-tenth the size of the solution domain in the X- and Y-directions.");
MGCAddSnippet(193, "Use this property sheet to configure a PCB.");
MGCAddSnippet(194, "Use this property sheet tab to define the PCB construction. The main categorization is whether the board is conducting or non-conducting.");
MGCAddSnippet(195, "Use this property sheet tab to view the calculated effects of components added to the PCB.");
MGCAddSnippet(196, "You can use the Component SmartPart (also known as the PCB Component SmartPart) to model a PCB component as a planar or 3D heat source, or the heat can be smeared over the board.");
MGCAddSnippet(197, "PCB components can be represented by adding PCB Component SmartParts to PCB SmartParts.");
MGCAddSnippet(198, "PCB Components are created as rectangular-shaped objects attached on one of the sides of the parent PCB board.");
MGCAddSnippet(199, "Use this property sheet to configure a PCB component.");
MGCAddSnippet(200, "Use this tab to edit the component selected in the data display and, if required, create a pattern of new components based on this component.");
MGCAddSnippet(201, "Use the Perforated Plate SmartPart to model perforated plates.");
MGCAddSnippet(202, "Perforated plates are modeled in Simcenter Flotherm using a Perforated Plate SmartPart. Perforated Plate SmartParts are created as children of assemblies.");
MGCAddSnippet(203, "The properties of Perforated Plate SmartParts are described in the following subsections and in the property sheet description.");
MGCAddSnippet(204, "Infrared radiation and solar radiation are treated separately.");
MGCAddSnippet(205, "Use this property sheet to configure a perforated plate.");
MGCAddSnippet(206, "Use this property sheet tab to set up the modeling data for the perforated plate. There are three possible models: Automatic, Standard, and Advanced. The fields available for data entry depend on which model is chosen.");
MGCAddSnippet(207, "The Power Map SmartPart uses HyperLynx data to model Joule heating.");
MGCAddSnippet(208, "Power Maps are created from CSV files exported from Mentor Graphics HyperLynx PI (Power Integrity).");
MGCAddSnippet(209, "Use Power Map SmartParts to predict the temperatures of (high) current carrying copper nets in PCBs.");
MGCAddSnippet(210, "Power Maps exported from HyperLynx can be used to model Joule heating in PCBs.");
MGCAddSnippet(211, "Geometry and power data from imported HyperLynx files is used to model the effects of Joule heating.");
MGCAddSnippet(212, "The following procedure uses geometry data from imported files, but power is determined from Potential Sources attached to PCB layers.");
MGCAddSnippet(213, "Use this property sheet to configure a power map.");
MGCAddSnippet(214, "Use this property sheet to define the name of the Power Map Layer or to hide the Layer.");
MGCAddSnippet(215, "Use this property sheet to define the name of the Power Map Vias or to hide the Vias.");
MGCAddSnippet(216, "Use Rack SmartParts to model Data Center racks.");
MGCAddSnippet(217, "The Rack SmartPart can represent any row-based or room-based Data Center rack.");
MGCAddSnippet(218, "When Racks are created, they have Extract and Supply SmartParts added as children.");
MGCAddSnippet(219, "Use this property sheet to configure a rack.");
MGCAddSnippet(220, "Use this property sheet tab to change the specification of a Rack SmartPart.");
MGCAddSnippet(221, "Use Recirculation Device SmartParts to model heat exchangers, CRAC units and blowers.");
MGCAddSnippet(222, "The recirculation device is a convenient way to represent systems such as fan coil units that recirculate air by extracting it from the enclosure, then conditioning and returning it.");
MGCAddSnippet(223, "The following subsections give examples of using recirculation devices to model heat exchangers.");
MGCAddSnippet(224, "The simple heat exchanger model is that of a heat exchanger where the air passing through the recirculation device can be regarded as in contact with a secondary having a specified temperature.");
MGCAddSnippet(225, "The LMTD model is similar to the Simple Exchanger model except that the fluid on the secondary side is not at a fixed temperature.");
MGCAddSnippet(226, "The CRAC Heat Exchanger models Computer Room Air Conditioning Devices (CRACs), for example, to model data centers.");
MGCAddSnippet(227, "To model blowers, in addition to specifying the recirculating flow, you add a surrounding casing and define the shear profile.");
MGCAddSnippet(228, "When Recirculation Devices are created, they have Extract and Supply SmartParts added as children.");
MGCAddSnippet(229, "The properties of Recirculation Device SmartParts are described in the following subsections and in the property sheet description.");
MGCAddSnippet(230, "The flow rate of the air passing through the recirculation device, is defined using one of four methods.");
MGCAddSnippet(231, "The cooling (or heating) of the air which passes through a recirculation device can be defined by as a temperature change, as a heat extraction rate, as a heat exchanger, or as a CRAC unit.");
MGCAddSnippet(232, "When running a transient calculation, a thermostat can be activated to control the flow or heating/cooling from the recirculation device.");
MGCAddSnippet(233, "With no fan relaxation is set (Solver Control tab) then a recirculation device with fan curves may cause the solution to diverge.");
MGCAddSnippet(234, "Use this property sheet to configure a recirculation device.");
MGCAddSnippet(235, "Use this property sheet tab to change the specification of a heating or refrigeration circuit SmartPart. By optionally adding a fan curve and a shear output profile, you can model blowers.");
MGCAddSnippet(236, "For transient cases only. Use this property sheet to define the location and controls for a thermostat which enables the flows on either side of a recirculation device to be controlled by a temperature sensor. ");
MGCAddSnippet(237, "Region SmartParts define spaces in the model.");
MGCAddSnippet(238, "Use regions to capture values, refine the grid or create new projects from existing projects.");
MGCAddSnippet(239, "By default, regions define volumes, but they can be collapsed to create plane (2D) regions.");
MGCAddSnippet(240, "After solution, the mean flow results as well as the mean, minimum, and maximum values for any variable, can then be tabulated over this new region when in Analyze mode.");
MGCAddSnippet(241, "A volume region can be used to define a space which contains an alternative fluid to the base fluid (as a Fluid attribute attachment). This can be used, for example, to create a water cooled heat sink.");
MGCAddSnippet(242, "When there are locations within the flow where the grid is not locally dependent on the geometry, regions can be added with attached grid constraints to refine the grid at the location.");
MGCAddSnippet(243, "Use this property sheet to configure a region.");
MGCAddSnippet(244, "Use Resistance SmartParts for setting the resistance to the airflow distributed across a finite volume or plane (collapsed resistance).");
MGCAddSnippet(245, "You can define volume or planar (2D) resistances.");
MGCAddSnippet(246, "To create a new resistance, you first create the resistance geometry and then attach the resistance attribute.");
MGCAddSnippet(247, "In addition to the 90 degree-step rotation that can be applied to geometry (for example, Geometry > Rotate Clockwise), collapsed resistances can be rotated more accurately using the Resistance property sheet.");
MGCAddSnippet(248, "Use this property sheet to configure a resistance.");
MGCAddSnippet(249, "Use this property sheet to define an angle of rotation of a collapsed resistance.");
MGCAddSnippet(250, "Use Sloping Block SmartParts to represent cuboids with surfaces not aligned with the coordinate axes.");
MGCAddSnippet(251, "Sloping blocks are rotated cuboids with the ends cut perpendicular to the end of the block.");
MGCAddSnippet(252, "The default Sloping Block is a thin angled plate with a 45 degree slope which has a smooth, non-conducting surface.");
MGCAddSnippet(253, "Thin Sloping Blocks are totally opaque to radiation, they absorb no solar radiation.");
MGCAddSnippet(254, "Use this property sheet to configure a sloping block.");
MGCAddSnippet(255, "Use this property sheet tab to define a cuboid whose surfaces are not parallel to the coordinate axes. A Sloping Block is assumed to be a rotated cuboid with the ends cut perpendicular to the end of the block.");
MGCAddSnippet(256, "Use Source SmartParts to simulate the velocity, pressure, and temperature over a planar area or volume.");
MGCAddSnippet(257, "You can use sources to simulate the source of heat because of the dissipation of electrical power within a volume, and a planar (or collapsed) source can be used to set a source of heat that is distributed uniformly over a surface.");
MGCAddSnippet(258, "Use this property sheet to configure a source.");
MGCAddSnippet(259, "Supply SmartParts are children of Recirculation Device, Rack, and Cooler SmartParts.");
MGCAddSnippet(260, "Supplies are physically defined by their dimensions, free area ratio and supply direction, which can be normal, angled, or sheared.");
MGCAddSnippet(261, "Use this property sheet to configure a supply.");
MGCAddSnippet(262, "Use this property sheet tab to define the supply of a recirculation device.");
MGCAddSnippet(263, "Use TEC SmartParts to model thermoelectric coolers.");
MGCAddSnippet(264, "A TEC is represented in the GUI as two abutting cuboids: one each for the hot and cold sides.");
MGCAddSnippet(265, "A pair of monitor points can be added in a single operation.");
MGCAddSnippet(266, "TECs are most commonly modeled sitting between the top of a component and heat sink.");
MGCAddSnippet(267, "A common goal is to determine the operating current required to achieve the desired performance, that is, limit component junction temperature. The operating current can be determined using the Command Center.");
MGCAddSnippet(268, "The relationship between TEC size (length and width, but not height) and its thermal performance is of interest to the designer.");
MGCAddSnippet(269, "The following subsections give information about TEC SmartParts represented in Results Tables, the Command Center and MCAD Bridge");
MGCAddSnippet(270, "Use this property sheet to configure a TEC.");
MGCAddSnippet(271, "Use this property sheet tab to define the general operation and structure of the selected TEC SmartPart. ");
MGCAddSnippet(272, "Use this property sheet tab to enter manufacturer s data for a specific hot side temperature. There are two tabs for two sets of data at two temperatures.");
MGCAddSnippet(273, "Model objects transferred from EDA Bridge.");
MGCAddSnippet(274, "EDA SmartParts are SmartParts that are created in Simcenter Flotherm when a board model is transferred from EDA Bridge.");
MGCAddSnippet(275, "To simplify the data tree, EDA SmartParts have the Lightweight option switched on by default. Use this procedure to extend EDA SmartParts into their constituent SmartParts and primitives.");
MGCAddSnippet(276, "MotherBoards and DaughterBoards transferred from EDA Bridge.");
MGCAddSnippet(277, "The EDA Board SmartPart is equivalent to the MotherBoard or DaughterBoard modeling object in EDA Bridge.");
MGCAddSnippet(278, "Use this property sheet to view and change properties of an EDA Board.");
MGCAddSnippet(279, "Use this property sheet to view the size, rotation, and material of the board. If the board is a DaughterBoard, then you can also view the properties of the mounting to the MotherBoard.");
MGCAddSnippet(280, "Cans transferred from EDA Bridge.");
MGCAddSnippet(281, "The EDA Can SmartPart is equivalent to the Can modeling object in EDA Bridge.");
MGCAddSnippet(282, "Use this property sheet to view and change properties of an EDA Can.");
MGCAddSnippet(283, "Use this property sheet to view the location, size, and material of a Can.");
MGCAddSnippet(284, "Rectangular and Cylindrical Components transferred from EDA Bridge.");
MGCAddSnippet(285, "The EDA Component SmartPart is equivalent to the Rectangular Component or Cylindrical Component modeling object in EDA Bridge.");
MGCAddSnippet(286, "Use this property sheet to view and change properties of an EDA Component.");
MGCAddSnippet(287, "Use this property sheet to view a component and its position on the board.");
MGCAddSnippet(288, "Electrical Vias Assemblies transferred from EDA Bridge.");
MGCAddSnippet(289, "The EDA Electrical Vias Assembly SmartPart is equivalent to the Electrical Vias Assembly modeling object in EDA Bridge.");
MGCAddSnippet(290, "Use this property sheet to view and change properties of an EDA Electrical Vias Assembly.");
MGCAddSnippet(291, "Electrical Vias transferred from EDA Bridge.");
MGCAddSnippet(292, "The EDA Electrical Vias SmartPart is equivalent to the Electrical Vias modeling object in EDA Bridge when Electrical Vias are applied to a whole board.");
MGCAddSnippet(293, "Use this property sheet to view and change properties of EDA Electrical Vias.");
MGCAddSnippet(294, "Functional Groups transferred from EDA Bridge.");
MGCAddSnippet(295, "The EDA Functional Group SmartPart is equivalent to the Functional Group modeling object in EDA Bridge.");
MGCAddSnippet(296, "Use this property sheet to view and change properties of an EDA Functional Group.");
MGCAddSnippet(297, "Use this property sheet to view the identity of a Functional Group.");
MGCAddSnippet(298, "Heatsinks transferred from EDA Bridge.");
MGCAddSnippet(299, "The EDA Heat Sink SmartPart is equivalent to the Heatsink modeling object in EDA Bridge.");
MGCAddSnippet(300, "Use this property sheet to view and change properties of an EDA Heat Sink.");
MGCAddSnippet(301, "Use this property sheet to view the dimensions and construction of a heat sink.");
MGCAddSnippet(302, "The layers container transferred from EDA Bridge.");
MGCAddSnippet(303, "The EDA Layer Assembly SmartPart is equivalent to Group Layers in EDA Bridge.");
MGCAddSnippet(304, "Use this property sheet to view and change properties of an EDA Layer Assembly.");
MGCAddSnippet(305, "Use this property sheet to view whether the layers in the assembly are equally spaced or not, and the offset distances of the layers.");
MGCAddSnippet(306, "Individual board layers transferred from EDA Bridge.");
MGCAddSnippet(307, "The EDA Layer SmartPart is equivalent to the Layer modeling object in EDA Bridge.");
MGCAddSnippet(308, "Use this property sheet to view and change properties of an EDA Layer.");
MGCAddSnippet(309, "Use this property sheet to view the properties of a board layer.");
MGCAddSnippet(310, "Potting Compound transferred from EDA Bridge.");
MGCAddSnippet(311, "The EDA Potting Compound SmartPart is equivalent to the Potting Compound modeling object in EDA Bridge.");
MGCAddSnippet(312, "Use this property sheet to view and change properties of an EDA Potting Compound.");
MGCAddSnippet(313, "Use this property sheet to view the location, size, and material of potting compound.");
MGCAddSnippet(314, "Thermal Vias imported from EDA Bridge.");
MGCAddSnippet(315, "The EDA Thermal Via SmartPart is equivalent to the Thermal Via modeling object in EDA Bridge.");
MGCAddSnippet(316, "Use this property sheet to view and change properties of EDA Thermal Vias.");
MGCAddSnippet(317, "Use this property sheet to view the construction properties of a staggered or unstaggered array of PCB thermal vias.");

